import React from 'react';
import { Link } from "react-router-dom";
import ReactDOM from 'react-dom/client';
import './Login.css';  // Import the CSS file
import logo from '../../assets/Logo.png';  // Import the logo image
import illustration from '../../assets/Moneyverse Home Office.png';  // Import another image
// import Settings from "../Settings/Settings.jsx";
// import Header from "../../components/Header/header";
import Calender from "./Calender";
import jQuery from 'jquery';

import axios from 'axios';
//import Approver from '../Approver/Approver';

axios.defaults.withCredentials = true;
axios.defaults.xsrfCookieName = 'csrftoken'
axios.defaults.xsrfHeaderName = 'x-csrftoken' 
class LoginPage extends React.Component{
  
  state = {
    email:"",
    password:"",
    response:"",
  }
  
  handleInput = (e:React.ChangeEvent<HTMLInputElement>) => { 
    this.setState({ 
        [e.target.name]: e.target.value, 
    }); 
  };

  setCSRF = ()=>{
    let csrfURL = 'http://127.0.0.1:8000/setcsrf/';//,'http://127.0.0.1:8000/setcsrf/'];
    const response = axios.get(csrfURL);
    console.log(response)
    return 
  };
  
  get_cookie = (name:string) => {
    var cookieValue = null;
    if (document.cookie && document.cookie !== '') {
        var cookies = document.cookie.split(';');
        for (var i = 0; i < cookies.length; i++) {
            var cookie = jQuery.trim(cookies[i]);
            if (cookie.substring(0, name.length + 1) === (name + '=')) {
                cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
                break;
            }
        }
    }
    return cookieValue;
  };

  submitLogin=async()=>{
    
    this.setCSRF()
    console.log(this.get_cookie('csrftoken'))
    console.log(this.state.email)
    console.log(this.state.password)

    let axioConfig={
      headers:{
        'X-CSRFToken':this.get_cookie('csrftoken')
      },
      Credential:'include',
      withCredentials:true,
    }
    axios.post("http://127.0.0.1:8000/login/",{//"http://127.0.0.1:8000/login/",{
        email: this.state.email,
        password: this.state.password,
      },axioConfig)
      .then((res)=>{
        console.log(res.data)
        if(res.status===200){
          console.log("login success")
          console.log(res.data[0]['role'])
          if(res.data[0]['role']===1){
            /*render(<Link to="/upload"/>)
            /*<Link to="/upload">
              const link = document.createElement('a')
              link.href = "/Settings"
              //link.setAttribute('download',"file.zip")
              document.body.appendChild(link)
              link.click()
            </Link>
            const link = document.createElement('a')
            link.href = '/'+Admin
            //link.setAttribute('download',"file.zip")
            document.body.appendChild(link)
            link.click()*/
            const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);
            root.render(<Calender/>);
          }
                     
        }
        else{
          console.log("error login")
          console.log(res.status)
          
        }
        
    })
    .catch((err) =>{});
    
  };

  render(){
  return (
      <div className='body-login'>
        <div className="container-login">
          
          <div className="left-section">
            <div className="logo-login">
                <a href="/">
                    <img src={logo} alt="Logo" className="logo"/>
                </a>
            </div>
            <h1>Welcome Back</h1>
            <p>By signing up, you agree to the <a href="#">Terms of use</a> and <a href="#">Privacy Policy</a>.</p>
            <form onSubmit={this.submitLogin} >
              <label htmlFor="username">Email</label>
              <input type="username" id="username" name="email" value={this.state.email} onChange={this.handleInput}/>

              <label htmlFor="password">Password</label>
              <input type="password" id="password" name="password" value={this.state.password} onChange={this.handleInput}/>

              <button id="button-loginn" type="submit">Sign in</button>
            </form>
            <div className="forgot-password">
              <a href="/forgotPass">Forgot password</a>
            </div>
            <div className="bottom-right">
              <p>Don't have an account?</p> <a href="/signup">Sign Up</a>
            </div>
          </div>

          <div className="right-section">
            <div className="plan-details">
              {/* Use the imported illustration */}
              <img src={illustration} alt="Security Illustration"/>
              <p>Your plan includes:</p>
              <ul>
                <li>• Limited projects and resources</li>
                <li>• Limited upload size</li>
                <li>• Limited storage</li>
                <li>• List, Board, and Calendar views...</li>
              </ul>
            </div>
          </div>

        </div>
      </div>
  );
  //};
}
}

export default LoginPage;
